Jag har lärt mig att säga nej till saker som jag vanligtvis hade tackat ja till direkt. Men nu på senaste har ångesten kommit krypande igen och jag har slutat säga nej och börjat säga ja istället. Det är på gott och ont. Mest ont för jag får ju ta smällen dagen efter. Men det kan helt klart vara värt det också såklart. Men då blir jag sängliggande dagen efter. Ibland i två dagar. Att vara ute i skogen, naturen och bara ta en promenad funkar för mig. Men inte så mycket mer och det har fått mig att uppskatta att vara utomhus mycket mer. 

Det jobbiga är att ingen ser att du är sjuk. Ibland känns det som man bara tror att det är på låtsas. Jag ser ju frisk ut, jag ser ut som vanligt men bara det att jag konstant har denna smärta och blir trött och utmattad av minsta lilla. 

Jag vet inte vad jag ville med detta inlägg egentligen.. Känns väldigt naket helt plötsligt. Allt jag ville var bara att önska er en trevlig helg och ett stort TACK för att ni följer mig och min matlagning! Och ÄNNU större TACK till min älskade och finaste sambo som alltid får mig glad, gör allt för att få mig att må bättre och alltid finns där för mig! Och självklart till mina vänner som orkar med mig, mitt gnäll och mina nej!

Trevlig helg! ❤️
